import styled from 'styled-components';

export const Nav = styled.nav`
    position: absolute;
    display: flex;
    width: 100%;
    flex-direction: column;
    height: 78.7px;
    padding-bottom: 10px;
    justify-content: flex-end;
    z-index:99;
    background: #000;

@media screen and (max-width: 960px){
    transition: 0.8s all ease;
}



`

